// OntologyList.js
import { useState, useEffect } from 'react';
import axios from 'axios';
import {List} from 'react-virtualized';
import './App.css';

import OntologyListItem from './OntologyListItem';

function OntologyList({handleSelectOntology}) {
    const [ontologies, setOntologies] = useState([]);

    useEffect(() => {
        const fetchOntologies = async () => {
            const result = await axios.get('http://localhost:8080/api/ontologies');

            setOntologies(result.data);
        };

        fetchOntologies();
    }, []);

    const testList = ['test1', 'test2', 'test3', 'test4', 'test5', 'test6', 'test7', 'test8']

    const listItems = ontologies.map((ontology) =>
        <li key={ontology}>
            <OntologyListItem
                ontology={ontology}
                onSelect={() => handleSelectOntology}
            />
        </li>
    );

    function rowRenderer({
                             key, // Unique key within array of rows
                             index, // Index of row within collection
                             isScrolling, // The List is currently being scrolled
                             isVisible, // This row is visible within the List (eg it is not an overscanned row)
                             style, // Style object to be applied to row (to position it)
                         }) {
        return (
            <div key={key}>
                {testList.map(ontology => (
                    <OntologyListItem
                        ontology={ontology}
                        onSelect={() => handleSelectOntology}
                    />
                ))}
            </div>
        );
    }

    return (
        /* <List
            width={300}
            height={300}
            rowCount={ontologies.length}
            rowHeight={200}
            rowRenderer={rowRenderer}
        /> */

        <ul>{listItems}</ul>
    );
}

export default OntologyList;
